// import * as React from 'react';
import Button from '@mui/material/Button';
// import DeleteIcon from '@mui/icons-material/Delete';
// import SendIcon from '@mui/icons-material/Send';
// import Stack from '@mui/material/Stack';
// import swal from "sweetalert";
// import { useDispatch, useSelector } from 'react-redux'
// import { addUser } from "./redux/Action";
// import Box from '@mui/material/Box';
import swal from 'sweetalert'
import TextField from '@mui/material/TextField';
import { useState } from 'react';
import { login, signIn } from '../api';
// import {navigate} from /navigate";
// import { useNavigate } from "react-router-dom";
// import { SetUser } from "./redux/Action";
// import { useState } from "react";
// import './style.css'

export const SignIn = () => {
    //     let emailRef=useRef()
    // let passwordRef=useRef()
    // let phoneRef=useRef()
    const [user, setUser] = useState({});
    const send = () => {
        if (user.email && user.password && user.phone) {
            signIn(user)
                .then(x => {
                    swal("ברוך הבא","ההרשמה בוצעה בהצלחה","success");

                })
                .catch(x => {
                    swal("!!!!שגיאה ",`שגיאה מספר ${x.status}`,"error");

                })
        }
        else{
            swal("!!!!שגיאה ","מלא את כל השדות","error");   
        }

    }
    return <>
        <div className='login'>
            <h2 id="h4">התחברות</h2>
            <TextField id="outlined-basic" label=" הכנס אימייל" variant="outlined" onBlur={e => { setUser({ ...user, email: e.target.value }) }} />
            <p className="error"></p>
            <TextField id="outlined-basic" label=" הכנס סיסמה" variant="outlined" onBlur={e => { setUser({ ...user, password: (Number)(e.target.value) }) }} />
            <p className="error"> </p>
            <TextField id="outlined-basic" label=" הכנס  טלפון" variant="outlined" onBlur={e => { setUser({ ...user, phone: e.target.value }) }} />
            <p className="error"></p>
            <TextField id="outlined-basic" label="הכנס טלפון נוסף- לא חובה" variant="outlined" onBlur={e => { setUser({ ...user, otherphone: e.target.value }) }} />
            <p className="error"></p>
            <Button className='buto' variant="contained"   onClick={send}>
                שליחה
            </Button>
        </div>

    </>
}
